"""# **Euclidean Distance (Öklid Mesafesi)**

![öklit.png](data:image/png;base64,)

En yaygın uzaklık ölçüsü olan Öklid mesafesi ile başlıyoruz. İki noktayı birleştiren bir segmentin uzunluğu olarak en iyi açıklanabilecek bir mesafe ölçüsüdür.

Mesafe Pisagor teoremi kullanılarak noktaların kartezyen koordinatlarından hesaplandığı için formül oldukça basittir.

![mklit formül.png](data:image/png;base64,)

**Dezavantajları**

Yaygın bir mesafe ölçüsü olmasına rağmen, Öklid mesafesi değişken olarak ölçeklenmez, bu da hesaplanan mesafelerin özelliklerin birimlerine bağlı olarak çarpıtılabileceği anlamına gelir. Tipik olarak, bu mesafe ölçüsünü kullanmadan önce verileri normalize etmek gerekir .

Dahası, verilerinizin boyutsallığı arttıkça, Öklid mesafesi daha az kullanışlı hale gelir.

**Kullanım Durumları**

Öklid mesafesi, düşük boyutlu verileriniz olduğunda ve vektörlerin büyüklüğünün ölçülmesi önemli olduğunda harika çalışıyor. Düşük boyutlu verilerde Öklid mesafesi kullanılırsa, kNN ve HDBSCAN gibi yöntemler kutunun dışında harika sonuçlar gösterir.
"""

def EuclideanDistance(a,b):
    print("1.liste : ",a)
    print("2.liste : ",b)
    return math.sqrt(sum(((y-x)**2) for x,y in zip(a,b)))#girilen koordinatların farkının karesini alıp topladıktan sonra karekökünü alıyoruz.

liste1 = liste1()
liste2 = liste2()
EuclideanDistance = EuclideanDistance(liste1,liste2)
print("Euclidean Distance = ",EuclideanDistance)

"""# **Cosine Similarity (Kosinüs Benzerliği)**

![kosinüs.png](data:image/png;base64,)

Kosinüs benzerliği, genellikle Öklid mesafesinin yüksek boyutsallıkla ilgili sorununa karşı koymanın bir yolu olarak kullanılmıştır. Kosinüs benzerliği, basitçe iki vektör arasındaki açının kosinüsüdür. Ayrıca, her ikisi de bir uzunluğa sahip olacak şekilde normalize edilmişlerse vektörlerin aynı iç çarpımına sahiptir.

Tam olarak aynı yönelime sahip iki vektörün kosinüs benzerliği 1'dir, oysa birbirine taban tabana zıt iki vektörün benzerliği -1'dir.

![kosinüs formül.png](data:image/png;base64,)

**Dezavantajları**

Kosinüs benzerliğinin temel bir dezavantajı, vektörlerin büyüklüğünün hesaba katılmaması, sadece yönlerinin hesaba katılmasıdır. Pratikte bu, değerlerdeki farklılıkların tam olarak dikkate alınmadığı anlamına gelir. Örneğin bir tavsiye sistemi alırsanız, kosinüs benzerliği farklı kullanıcılar arasındaki derecelendirme ölçeğindeki farkı hesaba katmaz.

**Kullanım Durumları**

Yüksek boyutlu veriye sahip olduğumuzda ve vektörlerin büyüklüğü önemli olmadığında kosinüs benzerliğini sıklıkla kullanırız. Metin analizleri için, bu ölçü, veriler kelime sayılarıyla temsil edildiğinde oldukça sık kullanılır. Örneğin, bir sözcük bir belgede diğerine göre daha sık geçtiğinde, bu mutlaka bir belgenin o sözcükle daha fazla ilişkili olduğu anlamına gelmez. Belgelerin eşit olmayan uzunluklara sahip olması ve sayının büyüklüğünün daha az önemli olması söz konusu olabilir. O zaman, büyüklüğü göz ardı eden kosinüs benzerliğini en iyi şekilde kullanabiliriz.
"""

from numpy import dot #gerekli kütüphaneleri yüklüyoruz.
from numpy.linalg import norm
a = liste1()
b= liste2()
CosineSimilarity = dot(a, b)/(norm(a)*norm(b))#kosinüs benzerliği iç çarpımın normların çarpımına bölümünden hesaplanır.
print("1.liste : ",a)
print("2.liste : ",b)
print("Cosine Similarity = 3,",CosineSimilarity)

"""# **ManhattanDistance (Manhattan Mesafesi)**

![manhattan.png](data:image/png;base64,)

Genellikle Taxicab mesafesi veya City Block mesafesi olarak adlandırılan Manhattan mesafesi, gerçek değerli vektörler arasındaki mesafeyi hesaplar. Satranç tahtası gibi tek tip bir ızgara üzerindeki nesneleri tanımlayan vektörleri hayal edin. Manhattan mesafesi, sadece dik açılarda hareket edebiliyorlarsa, iki vektör arasındaki mesafeyi ifade eder. Mesafenin hesaplanmasında herhangi bir çapraz hareket yoktur.

![manhattanFormul.png](data:image/png;base64,)

**Dezavantajları**

Manhattan mesafesi yüksek boyutlu veriler için iyi çalışıyor gibi görünse de , özellikle yüksek boyutlu verilerde kullanıldığında, öklid mesafesinden biraz daha az sezgisel olan bir ölçüdür.

Dahası, mümkün olan en kısa yolu olmadığı için öklid mesafesinden daha yüksek bir mesafe değeri verme olasılığı daha yüksektir.

**Kullanım Durumları**

Veri kümeniz ayrık ve / veya ikili özniteliklere sahip olduğunda, Manhattan, bu özniteliklerin değerleri dahilinde gerçekçi bir şekilde alınabilecek yolları hesaba kattığı için oldukça iyi çalışıyor gibi görünüyor. Örneğin, Öklid mesafesini ele alalım, gerçekte bu mümkün olmadığında, iki vektör arasında düz bir çizgi oluşturacaktır.
"""

def ManhattanDistance(a,b):
    print("1.liste : ",a)
    print("2.liste : ",b)
    return sum((abs(y-x)) for x,y in zip(a,b))#Manhattan Mesafesi koordinatların mutlak değer içinde farkını alıp toplayarak bulunur.

liste1 = liste1()
liste2 = liste2()
ManhattanDistance= ManhattanDistance(liste1,liste2)
print("Manhattan Distance = ",ManhattanDistance)

"""# **Minkowski**

![minskowski.png](data:image/png;base64,)

Minkowski mesafesi, çoğundan biraz daha karmaşık bir ölçüdür. Bu, Normlu vektör uzayında (n boyutlu gerçek uzay) kullanılan bir metriktir, yani mesafelerin uzunluğu olan bir vektör olarak temsil edilebildiği bir uzayda kullanılabilir.

Bu önlemin üç gereksinimi vardır:

=>Sıfır Vektör - Sıfır vektörünün uzunluğu sıfır iken, diğer her vektörün pozitif bir uzunluğu vardır. Örneğin, bir yerden başka bir yere gidersek, o zaman bu mesafe her zaman pozitiftir. Ancak, bir yerden kendisine gidersek, o zaman bu mesafe sıfırdır.

=>Skaler Faktör - Vektörü pozitif bir sayı ile çarptığınızda, yönü korunurken uzunluğu değiştirilir. Örneğin bir yönde belli bir mesafeye gidip aynı mesafeyi toplarsak yön değişmez.

=>Üçgen Eşitsizliği - İki nokta arasındaki en kısa mesafe düz bir çizgidir.

![mkwskFormul.png](data:image/png;base64,)

Bu mesafe ölçüsü hakkında en ilginç olanı, parametrenin kullanılmasıdır ('p') .Bu parametreyi, mesafe ölçümlerini başkalarına çok benzeyecek şekilde değiştirmek için kullanabiliriz.

Ortak değerleri 'p' şunlardır:

p = 1 - Manhattan mesafesi

p = 2 - Öklid mesafesi

p = ∞ - Chebyshev mesafesi

Minkowski, temsil ettikleri mesafe ölçüleriyle aynı dezavantajlara sahiptir, bu nedenle Manhattan, Öklid ve Chebyshev mesafesi gibi ölçümlerin iyi anlaşılması son derece önemlidir.

**Kullanım Durumları**

Bunun tersi, 'p' üzerinde yineleme ve kullanım durumunuza en uygun mesafe ölçüsünü bulma olasılığıdır. Mesafe ölçünüz üzerinde size büyük miktarda esneklik sağlar.
"""

def Minkowski(a,b,p):
    print("1.liste : ",a)
    print("2.liste : ",b)
    return (sum(((abs(y-x))**p) for x,y in zip(a,b)))**(1/p)#formül'ü uyguluyoruz. Önce mutlak değer içerisinde farkının 'p' kuvvetini alıp topluyoruz.Sonucu da '1/p' kuvvvetini alıyoruz.
liste1 = liste1()
liste2 = liste2()
print(Minkowski(liste1,liste2,1))
print(Minkowski(liste1,liste2,2))

"""# **HammingDistance (Hamming Mesafesi)**

![hamming.png](data:image/png;base64,)

Hamming mesafesi, iki vektör arasında farklı olan değerlerin sayısıdır. Genellikle eşit uzunluktaki iki ikili dizeyi karşılaştırmak için kullanılır. Birbirinden farklı olan karakter sayısını hesaplayarak dizelerin birbirlerine ne kadar benzer olduklarını karşılaştırmak için de kullanılabilir.

![hammingFormul.png](data:image/png;base64,)

**Dezavantajları**

Tahmin edebileceğiniz gibi, iki vektör eşit uzunlukta olmadığında hamming mesafesinin kullanılması zordur. Hangi pozisyonların eşleşmediğini anlamak için aynı uzunluktaki vektörleri birbirleriyle karşılaştırmak istersiniz.

Ayrıca, farklı veya eşit oldukları sürece gerçek değeri hesaba katmaz. Bu nedenle, büyüklük önemli bir ölçü olduğunda bu mesafe ölçüsünün kullanılması tavsiye edilmez.

**Kullanım Durumları**

Tipik kullanım durumları, veriler bilgisayar ağları üzerinden iletildiğinde hata düzeltme / algılama içerir. Hatayı tahmin etmenin bir yolu olarak ikili bir sözcükteki bozulmuş bitlerin sayısını belirlemek için kullanılabilir.

Ayrıca, kategorik değişkenler arasındaki mesafeyi ölçmek için Hamming mesafesini de kullanabilirsiniz.
"""

def HammingDistance(a,b):
    print("1.liste : ",a)
    print("2.liste : ",b)
    return sum((abs(y-x)) for x,y in zip(a,b))/len(a)#mutlak değer içinde farkı alınıp çıkan her değer toplandıktan sonra liste uzunluğuna bölünür.
liste1 = liste1()
liste2 = liste2()
HammingDistance(liste1,liste2)
